import React, { useState, useEffect } from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const Vehiculos2 = () => {
  const [vehiculos, setVehiculos] = useState([]);

  useEffect(() => {
    setVehiculos([
      { id: 1, nombre: "Vehículo A", lat: 40.7128, lon: -74.0060 },
      { id: 2, nombre: "Vehículo B", lat: 34.0522, lon: -118.2437 },
    ]);
  }, []);

  return (
    <div>
      <h1>Vehículos en el Mapa</h1>
      <LoadScript googleMapsApiKey="AIzaSyCcF0vvhLLmuLAJcnh2ElM9aLcIwtiiwMo"> {/* Aquí va tu API Key */}
        <GoogleMap
          id="map"
          mapContainerStyle={{ width: '100%', height: '500px' }}
          center={{ lat: 40.7128, lng: -74.0060 }}
          zoom={12}
        >
          {vehiculos.map(vehiculo => (
            <Marker
              key={vehiculo.id}
              position={{ lat: vehiculo.lat, lng: vehiculo.lon }}
              title={vehiculo.nombre}
            />
          ))}
        </GoogleMap>
      </LoadScript>
      <div>
        <h2>Lista de Vehículos:</h2>
        <ul>
          {vehiculos.map(vehiculo => (
            <li key={vehiculo.id}>{vehiculo.nombre}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Vehiculos2;
